syntax = "proto3";

package proto;
option go_package = "./;proto";

import "ClientCollectorData.proto";

message ClientCollectorDataNotify {
  enum CmdId {
    option allow_alias = true;
    NONE = 0;
    ENET_CHANNEL_ID = 0;
    ENET_IS_RELIABLE = 1;
    CMD_ID = 4264;
  }

  repeated ClientCollectorData client_collector_data_list = 8;
}
